import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header'; // Import the Header component
import MainSection from './components/MainSection';
import ResearchArea from './components/ResearchArea';
import HomePage from './components/HomePage'; // Your component for the homepage
import PeoplePage from './components/PeoplePage'; // Your component for the people page
import ResearchPage from './components/ResearchPage'; // Your component for the research page
import PublicationsPage from './components/PublicationsPage'; // Your component for the publications page
import './App.css'; // Keep the App-wide CSS

function App() {
  return (
    <Router>
      <Header />
      <Routes> {/* Use Routes instead of Switch */}
        <Route path="/people" element={<PeoplePage />} />
        <Route path="/research" element={<ResearchPage />} />
        <Route path="/publications" element={<PublicationsPage />} />
        <Route path="/" element={<HomePage />} />
      </Routes>
    </Router>
  );
}

export default App;
